import React from "react";
import styled from "styled-components";
import {FaFilter} from "react-icons/fa";

const NavbarWrapper = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px 10px;
  width: 100%;
  height: 50px;
  background-color: #271815;
  color: #FFFFFF;
`;

const SearchBarWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #FFFFFF;
  width: 25%;
  height: 30px;
  border-radius: 2px;
`;

const SearchBar = () => (
    <SearchBarWrapper>
        <button>
            <FaFilter/>
            <span>Title</span>
        </button>
    </SearchBarWrapper>
);

const Navbar = () => (
    <NavbarWrapper>
        <span>Logo</span>
        <SearchBar>

        </SearchBar>
        <div></div>
        <div></div>
    </NavbarWrapper>
);

export default Navbar;
